        :: Python :: 3.3","Programming Language :: Python :: 3.4"],"description":"Requests:
        HTTP for Humans\n=========================\n\n.. image:: https://img.shields.io/pypi/v/requests.svg\n    :target:
        https://pypi.python.org/pypi/requests\n\n.. image:: https://img.shields.io/pypi/dm/requests.svg\n        :target:
        https://pypi.python.org/pypi/requests\n\n\nRequests is an Apache2 Licensed
        HTTP library, written in Python, for human\nbeings.\n\nMost existing Python
        modules for sending HTTP requests are extremely\nverbose and cumbersome. Python''s
        builtin urllib2 module provides most of\nthe HTTP capabilities you should
        need, but the api is thoroughly broken.\nIt requires an enormous amount of
        work (even method overrides) to\nperform the simplest of tasks.\n\nThings
        shouldn''t be this way. Not in Python.\n\n.. code-block:: python\n\n    >>>
        r = requests.get(''https://api.github.com'', auth=(''user'', ''pass''))\n    >>>
        r.status_code\n    204\n    >>> r.headers[''content-type'']\n    ''application/json''\n    >>>
        r.text\n    ...\n\nSee `the same code, without Requests <https://gist.github.com/973705>`_.\n\nRequests
        allow you to send HTTP/1.1 requests. You can add headers, form data,\nmultipart
        files, and parameters with simple Python dictionaries, and access the\nresponse
        data in the same way. It''s powered by httplib and `urllib3\n<https://github.com/shazow/urllib3>`_,
        but it does all the hard work and crazy\nhacks for you.\n\n\nFeatures\n--------\n\n-
        International Domains and URLs\n- Keep-Alive & Connection Pooling\n- Sessions
        with Cookie Persistence\n- Browser-style SSL Verification\n- Basic/Digest
        Authentication\n- Elegant Key/Value Cookies\n- Automatic Decompression\n-
        Unicode Response Bodies\n- Multipart File Uploads\n- Connection Timeouts\n-
        Thread-safety\n- HTTP(S) proxy support\n\n\nInstallation\n------------\n\nTo
        install Requests, simply:\n\n.. code-block:: bash\n\n    $ pip install requests\n\n\nDocumentation\n-------------\n\nDocumentation
        is available at http://docs.python-requests.org/.\n\n\nContribute\n----------\n\n#.
        Check for open issues or open a fresh issue to start a discussion around a
        feature idea or a bug. There is a `Contributor Friendly`_ tag for issues that
        should be ideal for people who are not very familiar with the codebase yet.\n#.
        If you feel uncomfortable or uncertain about an issue or your changes, feel
        free to email @sigmavirus24 and he will happily help you via email, Skype,
        remote pairing or whatever you are comfortable with.\n#. Fork `the repository`_
        on GitHub to start making your changes to the **master** branch (or branch
        off of it).\n#. Write a test which shows that the bug was fixed or that the
        feature works as expected.\n#. Send a pull request and bug the maintainer
        until it gets merged and published. :) Make sure to add yourself to AUTHORS_.\n\n..
        _`the repository`: http://github.com/kennethreitz/requests\n.. _AUTHORS: https://github.com/kennethreitz/requests/blob/master/AUTHORS.rst\n..
        _Contributor Friendly: https://github.com/kennethreitz/requests/issues?direction=desc&labels=Contributor+Friendly&page=1&sort=updated&state=open\n\n\n..
        :changelog:\n\nRelease History\n---------------\n\n2.5.3 (2015-02-24)\n++++++++++++++++++\n\n**Bugfixes**\n\n-
        Revert changes to our vendored certificate bundle. For more context see\n  (#2455,
        #2456, and http://bugs.python.org/issue23476)\n\n2.5.2 (2015-02-23)\n++++++++++++++++++\n\n**Features
        and Improvements**\n\n- Add sha256 fingerprint support. (`shazow/urllib3#540`_)\n\n-
        Improve the performance of headers. (`shazow/urllib3#544`_)\n\n**Bugfixes**\n\n-
        Copy pip''s import machinery. When downstream redistributors remove\n  requests.packages.urllib3
        the import machinery will continue to let those\n  same symbols work. Example
        usage in requests'' documentation and 3rd-party\n  libraries relying on the
        vendored copies of urllib3 will work without having\n  to fallback to the
        system urllib3.\n\n- Attempt to quote parts of the URL on redirect if unquoting
        and then quoting\n  fails. (#2356)\n\n- Fix filename type check for multipart
        form-data uploads. (#2411)\n\n- Properly handle the case where a server issuing
        digest authentication\n  challenges provides both auth and auth-int qop-values.
        (#2408)\n\n- Fix a socket leak. (`shazow/urllib3#549`_)\n\n- Fix multiple
        ``Set-Cookie`` headers properly. (`shazow/urllib3#534`_)\n\n- Disable the
        built-in hostname verification. (`shazow/urllib3#526`_)\n\n- Fix the behaviour
        of decoding an exhausted stream. (`shazow/urllib3#535`_)\n\n**Security**\n\n-
        Pulled in an updated ``cacert.pem``.\n\n- Drop RC4 from the default cipher
        list. (`shazow/urllib3#551`_)\n\n.. _shazow/urllib3#551: https://github.com/shazow/urllib3/pull/551\n..
        _shazow/urllib3#549: https://github.com/shazow/urllib3/pull/549\n.. _shazow/urllib3#544:
        https://github.com/shazow/urllib3/pull/544\n.. _shazow/urllib3#540: https://github.com/shazow/urllib3/pull/540\n..
        _shazow/urllib3#535: https://github.com/shazow/urllib3/pull/535\n.. _shazow/urllib3#534:
        https://github.com/shazow/urllib3/pull/534\n.. _shazow/urllib3#526: https://github.com/shazow/urllib3/pull/526\n\n2.5.1
        (2014-12-23)\n++++++++++++++++++\n\n**Behavioural Changes**\n\n- Only catch
        HTTPErrors in raise_for_status (#2382)\n\n**Bugfixes**\n\n- Handle LocationParseError
        from urllib3 (#2344)\n- Handle file-like object filenames that are not strings
        (#2379)\n- Unbreak HTTPDigestAuth handler. Allow new nonces to be negotiated
        (#2389)\n\n2.5.0 (2014-12-01)\n++++++++++++++++++\n\n**Improvements**\n\n-
        Allow usage of urllib3''s Retry object with HTTPAdapters (#2216)\n- The ``iter_lines``
        method on a response now accepts a delimiter with which\n  to split the content
        (#2295)\n\n**Behavioural Changes**\n\n- Add deprecation warnings to functions
        in requests.utils that will be removed\n  in 3.0 (#2309)\n- Sessions used
        by the functional API are always closed (#2326)\n- Restrict requests to HTTP/1.1
        and HTTP/1.0 (stop accepting HTTP/0.9) (#2323)\n\n**Bugfixes**\n\n- Only parse
        the URL once (#2353)\n- Allow Content-Length header to always be overriden
        (#2332)\n- Properly handle files in HTTPDigestAuth (#2333)\n- Cap redirect_cache
        size to prevent memory abuse (#2299)\n- Fix HTTPDigestAuth handling of redirects
        after authenticating successfully\n  (#2253)\n- Fix crash with custom method
        parameter to Session.request (#2317)\n- Fix how Link headers are parsed using
        the regular expression library (#2271)\n\n**Documentation**\n\n- Add more
        references for interlinking (#2348)\n- Update CSS for theme (#2290)\n- Update
        width of buttons and sidebar (#2289)\n- Replace references of Gittip with
        Gratipay (#2282)\n- Add link to changelog in sidebar (#2273)\n\n2.4.3 (2014-10-06)\n++++++++++++++++++\n\n**Bugfixes**\n\n-
        Unicode URL improvements for Python 2.\n- Re-order JSON param for backwards
        compat.\n- Automatically defrag authentication schemes from host/pass URIs.
        (`#2249 <https://github.com/kennethreitz/requests/issues/2249>`_)\n\n\n2.4.2
        (2014-10-05)\n++++++++++++++++++\n\n**Improvements**\n\n- FINALLY! Add json
        parameter for uploads! (`#2258 <https://github.com/kennethreitz/requests/pull/2258>`_)\n-
        Support for bytestring URLs on Python 3.x (`#2238 <https://github.com/kennethreitz/requests/pull/2238>`_)\n\n**Bugfixes**\n\n-
        Avoid getting stuck in a loop (`#2244 <https://github.com/kennethreitz/requests/pull/2244>`_)\n-
        Multiple calls to iter* fail with unhelpful error. (`#2240 <https://github.com/kennethreitz/requests/issues/2240>`_,
        `#2241 <https://github.com/kennethreitz/requests/issues/2241>`_)\n\n**Documentation**\n\n-
        Correct redirection introduction (`#2245 <https://github.com/kennethreitz/requests/pull/2245/>`_)\n-
        Added example of how to send multiple files in one request. (`#2227 <https://github.com/kennethreitz/requests/pull/2227/>`_)\n-
        Clarify how to pass a custom set of CAs (`#2248 <https://github.com/kennethreitz/requests/pull/2248/>`_)\n\n\n\n2.4.1
        (2014-09-09)\n++++++++++++++++++\n\n- Now has a \"security\" package extras
        set, ``$ pip install requests[security]``\n- Requests will now use Certifi
        if it is available.\n- Capture and re-raise urllib3 ProtocolError\n- Bugfix
        for responses that attempt to redirect to themselves forever (wtf?).\n\n\n2.4.0
        (2014-08-29)\n++++++++++++++++++\n\n**Behavioral Changes**\n\n- ``Connection:
        keep-alive`` header is now sent automatically.\n\n**Improvements**\n\n- Support
        for connect timeouts! Timeout now accepts a tuple (connect, read) which is
        used to set individual connect and read timeouts.\n- Allow copying of PreparedRequests
        without headers/cookies.\n- Updated bundled urllib3 version.\n- Refactored
        settings loading from environment -- new `Session.merge_environment_settings`.\n-
        Handle socket errors in iter_content.\n\n\n2.3.0 (2014-05-16)\n++++++++++++++++++\n\n**API
        Changes**\n\n- New ``Response`` property ``is_redirect``, which is true when
        the\n  library could have processed this response as a redirection (whether\n  or
        not it actually did).\n- The ``timeout`` parameter now affects requests with
        both ``stream=True`` and\n  ``stream=False`` equally.\n- The change in v2.0.0
        to mandate explicit proxy schemes has been reverted.\n  Proxy schemes now
        default to ``http://``.\n- The ``CaseInsensitiveDict`` used for HTTP headers
        now behaves like a normal\n  dictionary when references as string or viewed
        in the interpreter.\n\n**Bugfixes**\n\n- No longer expose Authorization or
        Proxy-Authorization headers on redirect.\n  Fix CVE-2014-1829 and CVE-2014-1830
        respectively.\n- Authorization is re-evaluated each redirect.\n- On redirect,
        pass url as native strings.\n- Fall-back to autodetected encoding for JSON
        when Unicode detection fails.\n- Headers set to ``None`` on the ``Session``
        are now correctly not sent.\n- Correctly honor ``decode_unicode`` even if
        it wasn''t used earlier in the same\n  response.\n- Stop advertising ``compress``
        as a supported Content-Encoding.\n- The ``Response.history`` parameter is
        now always a list.\n- Many, many ``urllib3`` bugfixes.\n\n2.2.1 (2014-01-23)\n++++++++++++++++++\n\n**Bugfixes**\n\n-
        Fixes incorrect parsing of proxy credentials that contain a literal or encoded
        ''#'' character.\n- Assorted urllib3 fixes.\n\n2.2.0 (2014-01-09)\n++++++++++++++++++\n\n**API
        Changes**\n\n- New exception: ``ContentDecodingError``. Raised instead of
        ``urllib3``\n  ``DecodeError`` exceptions.\n\n**Bugfixes**\n\n- Avoid many
        many exceptions from the buggy implementation of ``proxy_bypass`` on OS X
        in Python 2.6.\n- Avoid crashing when attempting to get authentication credentials
        from ~/.netrc when running as a user without a home directory.\n- Use the
        correct pool size for pools of connections to proxies.\n- Fix iteration of
        ``CookieJar`` objects.\n- Ensure that cookies are persisted over redirect.\n-
        Switch back to using chardet, since it has merged with charade.\n\n2.1.0 (2013-12-05)\n++++++++++++++++++\n\n-
        Updated CA Bundle, of course.\n- Cookies set on individual Requests through
        a ``Session`` (e.g. via ``Session.get()``) are no longer persisted to the
        ``Session``.\n- Clean up connections when we hit problems during chunked upload,
        rather than leaking them.\n- Return connections to the pool when a chunked
        upload is successful, rather than leaking it.\n- Match the HTTPbis recommendation
        for HTTP 301 redirects.\n- Prevent hanging when using streaming uploads and
        Digest Auth when a 401 is received.\n- Values of headers set by Requests are
        now always the native string type.\n- Fix previously broken SNI support.\n-
        Fix accessing HTTP proxies using proxy authentication.\n- Unencode HTTP Basic
        usernames and passwords extracted from URLs.\n- Support for IP address ranges
        for no_proxy environment variable\n- Parse headers correctly when users override
        the default ``Host:`` header.\n- Avoid munging the URL in case of case-sensitive
        servers.\n- Looser URL handling for non-HTTP/HTTPS urls.\n- Accept unicode
        methods in Python 2.6 and 2.7.\n- More resilient cookie handling.\n- Make
        ``Response`` objects pickleable.\n- Actually added MD5-sess to Digest Auth
        instead of pretending to like last time.\n- Updated internal urllib3.\n- Fixed
        @Lukasa''s lack of taste.\n\n2.0.1 (2013-10-24)\n++++++++++++++++++\n\n- Updated
        included CA Bundle with new mistrusts and automated process for the future\n-
        Added MD5-sess to Digest Auth\n- Accept per-file headers in multipart file
        POST messages.\n- Fixed: Don''t send the full URL on CONNECT messages.\n-
        Fixed: Correctly lowercase a redirect scheme.\n- Fixed: Cookies not persisted
        when set via functional API.\n- Fixed: Translate urllib3 ProxyError into a
        requests ProxyError derived from ConnectionError.\n- Updated internal urllib3
        and chardet.\n\n2.0.0 (2013-09-24)\n++++++++++++++++++\n\n**API Changes:**\n\n-
        Keys in the Headers dictionary are now native strings on all Python versions,\n  i.e.
        bytestrings on Python 2, unicode on Python 3.\n- Proxy URLs now *must* have
        an explicit scheme. A ``MissingSchema`` exception\n  will be raised if they
        don''t.\n- Timeouts now apply to read time if ``Stream=False``.\n- ``RequestException``
        is now a subclass of ``IOError``, not ``RuntimeError``.\n- Added new method
        to ``PreparedRequest`` objects: ``PreparedRequest.copy()``.\n- Added new method
        to ``Session`` objects: ``Session.update_request()``. This\n  method updates
        a ``Request`` object with the data (e.g. cookies) stored on\n  the ``Session``.\n-
        Added new method to ``Session`` objects: ``Session.prepare_request()``. This\n  method
        updates and prepares a ``Request`` object, and returns the\n  corresponding
        ``PreparedRequest`` object.\n- Added new method to ``HTTPAdapter`` objects:
        ``HTTPAdapter.proxy_headers()``.\n  This should not be called directly, but
        improves the subclass interface.\n- ``httplib.IncompleteRead`` exceptions
        caused by incorrect chunked encoding\n  will now raise a Requests ``ChunkedEncodingError``
        instead.\n- Invalid percent-escape sequences now cause a Requests ``InvalidURL``\n  exception
        to be raised.\n- HTTP 208 no longer uses reason phrase ``\"im_used\"``. Correctly
        uses\n  ``\"already_reported\"``.\n- HTTP 226 reason added (``\"im_used\"``).\n\n**Bugfixes:**\n\n-
        Vastly improved proxy support, including the CONNECT verb. Special thanks
        to\n  the many contributors who worked towards this improvement.\n- Cookies
        are now properly managed when 401 authentication responses are\n  received.\n-
        Chunked encoding fixes.\n- Support for mixed case schemes.\n- Better handling
        of streaming downloads.\n- Retrieve environment proxies from more locations.\n-
        Minor cookies fixes.\n- Improved redirect behaviour.\n- Improved streaming
        behaviour, particularly for compressed data.\n- Miscellaneous small Python
        3 text encoding bugs.\n- ``.netrc`` no longer overrides explicit auth.\n-
        Cookies set by hooks are now correctly persisted on Sessions.\n- Fix problem
        with cookies that specify port numbers in their host field.\n- ``BytesIO``
        can be used to perform streaming uploads.\n- More generous parsing of the
        ``no_proxy`` environment variable.\n- Non-string objects can be passed in
        data values alongside files.\n\n1.2.3 (2013-05-25)\n++++++++++++++++++\n\n-
        Simple packaging fix\n\n\n1.2.2 (2013-05-23)\n++++++++++++++++++\n\n- Simple
        packaging fix\n\n\n1.2.1 (2013-05-20)\n++++++++++++++++++\n\n- 301 and 302
        redirects now change the verb to GET for all verbs, not just\n  POST, improving
        browser compatibility.\n- Python 3.3.2 compatibility\n- Always percent-encode
        location headers\n- Fix connection adapter matching to be most-specific first\n-
        new argument to the default connection adapter for passing a block argument\n-
        prevent a KeyError when there''s no link headers\n\n1.2.0 (2013-03-31)\n++++++++++++++++++\n\n-
        Fixed cookies on sessions and on requests\n- Significantly change how hooks
        are dispatched - hooks now receive all the\n  arguments specified by the user
        when making a request so hooks can make a\n  secondary request with the same
        parameters. This is especially necessary for\n  authentication handler authors\n-
        certifi support was removed\n- Fixed bug where using OAuth 1 with body ``signature_type``
        sent no data\n- Major proxy work thanks to @Lukasa including parsing of proxy
        authentication\n  from the proxy url\n- Fix DigestAuth handling too many 401s\n-
        Update vendored urllib3 to include SSL bug fixes\n- Allow keyword arguments
        to be passed to ``json.loads()`` via the\n  ``Response.json()`` method\n-
        Don''t send ``Content-Length`` header by default on ``GET`` or ``HEAD``\n  requests\n-
        Add ``elapsed`` attribute to ``Response`` objects to time how long a request\n  took.\n-
        Fix ``RequestsCookieJar``\n- Sessions and Adapters are now picklable, i.e.,
        can be used with the\n  multiprocessing library\n- Update charade to version
        1.0.3\n\nThe change in how hooks are dispatched will likely cause a great
        deal of\nissues.\n\n1.1.0 (2013-01-10)\n++++++++++++++++++\n\n- CHUNKED REQUESTS\n-
        Support for iterable response bodies\n- Assume servers persist redirect params\n-
        Allow explicit content types to be specified for file data\n- Make merge_kwargs
        case-insensitive when looking up keys\n\n1.0.3 (2012-12-18)\n++++++++++++++++++\n\n-
        Fix file upload encoding bug\n- Fix cookie behavior\n\n1.0.2 (2012-12-17)\n++++++++++++++++++\n\n-
        Proxy fix for HTTPAdapter.\n\n1.0.1 (2012-12-17)\n++++++++++++++++++\n\n-
        Cert verification exception bug.\n- Proxy fix for HTTPAdapter.\n\n1.0.0 (2012-12-17)\n++++++++++++++++++\n\n-
        Massive Refactor and Simplification\n- Switch to Apache 2.0 license\n- Swappable
        Connection Adapters\n- Mountable Connection Adapters\n- Mutable ProcessedRequest
        chain\n- /s/prefetch/stream\n- Removal of all configuration\n- Standard library
        logging\n- Make Response.json() callable, not property.\n- Usage of new charade
        project, which provides python 2 and 3 simultaneous chardet.\n- Removal of
        all hooks except ''response''\n- Removal of all authentication helpers (OAuth,
        Kerberos)\n\nThis is not a backwards compatible change.\n\n0.14.2 (2012-10-27)\n+++++++++++++++++++\n\n-
        Improved mime-compatible JSON handling\n- Proxy fixes\n- Path hack fixes\n-
        Case-Insensistive Content-Encoding headers\n- Support for CJK parameters in
        form posts\n\n\n0.14.1 (2012-10-01)\n+++++++++++++++++++\n\n- Python 3.3 Compatibility\n-
        Simply default accept-encoding\n- Bugfixes\n\n\n0.14.0 (2012-09-02)\n++++++++++++++++++++\n\n-
        No more iter_content errors if already downloaded.\n\n0.13.9 (2012-08-25)\n+++++++++++++++++++\n\n-
        Fix for OAuth + POSTs\n- Remove exception eating from dispatch_hook\n- General
        bugfixes\n\n0.13.8 (2012-08-21)\n+++++++++++++++++++\n\n- Incredible Link
        header support :)\n\n0.13.7 (2012-08-19)\n+++++++++++++++++++\n\n- Support
        for (key, value) lists everywhere.\n- Digest Authentication improvements.\n-
        Ensure proxy exclusions work properly.\n- Clearer UnicodeError exceptions.\n-
        Automatic casting of URLs to tsrings (fURL and such)\n- Bugfixes.\n\n0.13.6
        (2012-08-06)\n+++++++++++++++++++\n\n- Long awaited fix for hanging connections!\n\n0.13.5
        (2012-07-27)\n+++++++++++++++++++\n\n- Packaging fix\n\n0.13.4 (2012-07-27)\n+++++++++++++++++++\n\n-
        GSSAPI/Kerberos authentication!\n- App Engine 2.7 Fixes!\n- Fix leaking connections
        (from urllib3 update)\n- OAuthlib path hack fix\n- OAuthlib URL parameters
        fix.\n\n0.13.3 (2012-07-12)\n+++++++++++++++++++\n\n- Use simplejson if available.\n-
        Do not hide SSLErrors behind Timeouts.\n- Fixed param handling with urls containing
        fragments.\n- Significantly improved information in User Agent.\n- client
        certificates are ignored when verify=False\n\n0.13.2 (2012-06-28)\n+++++++++++++++++++\n\n-
        Zero dependencies (once again)!\n- New: Response.reason\n- Sign querystring
        parameters in OAuth 1.0\n- Client certificates no longer ignored when verify=False\n-
        Add openSUSE certificate support\n\n0.13.1 (2012-06-07)\n+++++++++++++++++++\n\n-
        Allow passing a file or file-like object as data.\n- Allow hooks to return
        responses that indicate errors.\n- Fix Response.text and Response.json for
        body-less responses.\n\n0.13.0 (2012-05-29)\n+++++++++++++++++++\n\n- Removal
        of Requests.async in favor of `grequests <https://github.com/kennethreitz/grequests>`_\n-
        Allow disabling of cookie persistiance.\n- New implimentation of safe_mode\n-
        cookies.get now supports default argument\n- Session cookies not saved when
        Session.request is called with return_response=False\n- Env: no_proxy support.\n-
        RequestsCookieJar improvements.\n- Various bug fixes.\n\n0.12.1 (2012-05-08)\n+++++++++++++++++++\n\n-
        New ``Response.json`` property.\n- Ability to add string file uploads.\n-
        Fix out-of-range issue with iter_lines.\n- Fix iter_content default size.\n-
        Fix POST redirects containing files.\n\n0.12.0 (2012-05-02)\n+++++++++++++++++++\n\n-
        EXPERIMENTAL OAUTH SUPPORT!\n- Proper CookieJar-backed cookies interface with
        awesome dict-like interface.\n- Speed fix for non-iterated content chunks.\n-
        Move ``pre_request`` to a more usable place.\n- New ``pre_send`` hook.\n-
        Lazily encode data, params, files.\n- Load system Certificate Bundle if ``certify``
        isn''t available.\n- Cleanups, fixes.\n\n0.11.2 (2012-04-22)\n+++++++++++++++++++\n\n-
        Attempt to use the OS''s certificate bundle if ``certifi`` isn''t available.\n-
        Infinite digest auth redirect fix.\n- Multi-part file upload improvements.\n-
        Fix decoding of invalid %encodings in URLs.\n- If there is no content in a
        response don''t throw an error the second time that content is attempted to
        be read.\n- Upload data on redirects.\n\n0.11.1 (2012-03-30)\n+++++++++++++++++++\n\n*
        POST redirects now break RFC to do what browsers do: Follow up with a GET.\n*
        New ``strict_mode`` configuration to disable new redirect behavior.\n\n\n0.11.0
        (2012-03-14)\n+++++++++++++++++++\n\n* Private SSL Certificate support\n*
        Remove select.poll from Gevent monkeypatching\n* Remove redundant generator
        for chunked transfer encoding\n* Fix: Response.ok raises Timeout Exception
        in safe_mode\n\n0.10.8 (2012-03-09)\n+++++++++++++++++++\n\n* Generate chunked
        ValueError fix\n* Proxy configuration by environment variables\n* Simplification
        of iter_lines.\n* New `trust_env` configuration for disabling system/environment
        hints.\n* Suppress cookie errors.\n\n0.10.7 (2012-03-07)\n+++++++++++++++++++\n\n*
        `encode_uri` = False\n\n0.10.6 (2012-02-25)\n+++++++++++++++++++\n\n* Allow
        ''='' in cookies.\n\n0.10.5 (2012-02-25)\n+++++++++++++++++++\n\n* Response
        body with 0 content-length fix.\n* New async.imap.\n* Don''t fail on netrc.\n\n\n0.10.4
        (2012-02-20)\n+++++++++++++++++++\n\n* Honor netrc.\n\n0.10.3 (2012-02-20)\n+++++++++++++++++++\n\n*
        HEAD requests don''t follow redirects anymore.\n* raise_for_status() doesn''t
        raise for 3xx anymore.\n* Make Session objects picklable.\n* ValueError for
        invalid schema URLs.\n\n0.10.2 (2012-01-15)\n+++++++++++++++++++\n\n* Vastly
        improved URL quoting.\n* Additional allowed cookie key values.\n* Attempted
        fix for \"Too many open files\" Error\n* Replace unicode errors on first pass,
        no need for second pass.\n* Append ''/'' to bare-domain urls before query
        insertion.\n* Exceptions now inherit from RuntimeError.\n* Binary uploads
        + auth fix.\n* Bugfixes.\n\n\n0.10.1 (2012-01-23)\n+++++++++++++++++++\n\n*
        PYTHON 3 SUPPORT!\n* Dropped 2.5 Support. (*Backwards Incompatible*)\n\n0.10.0
        (2012-01-21)\n+++++++++++++++++++\n\n* ``Response.content`` is now bytes-only.
        (*Backwards Incompatible*)\n* New ``Response.text`` is unicode-only.\n* If
        no ``Response.encoding`` is specified and ``chardet`` is available, ``Respoonse.text``
        will guess an encoding.\n* Default to ISO-8859-1 (Western) encoding for \"text\"
        subtypes.\n* Removal of `decode_unicode`. (*Backwards Incompatible*)\n* New
        multiple-hooks system.\n* New ``Response.register_hook`` for registering hooks
        within the pipeline.\n* ``Response.url`` is now Unicode.\n\n0.9.3 (2012-01-18)\n++++++++++++++++++\n\n*
        SSL verify=False bugfix (apparent on windows machines).\n\n0.9.2 (2012-01-18)\n++++++++++++++++++\n\n*
        Asynchronous async.send method.\n* Support for proper chunk streams with boundaries.\n*
        session argument for Session classes.\n* Print entire hook tracebacks, not
        just exception instance.\n* Fix response.iter_lines from pending next line.\n*
        Fix but in HTTP-digest auth w/ URI having query strings.\n* Fix in Event Hooks
        section.\n* Urllib3 update.\n\n\n0.9.1 (2012-01-06)\n++++++++++++++++++\n\n*
        danger_mode for automatic Response.raise_for_status()\n* Response.iter_lines
        refactor\n\n0.9.0 (2011-12-28)\n++++++++++++++++++\n\n* verify ssl is default.\n\n\n0.8.9
        (2011-12-28)\n++++++++++++++++++\n\n* Packaging fix.\n\n\n0.8.8 (2011-12-28)\n++++++++++++++++++\n\n*
        SSL CERT VERIFICATION!\n* Release of Cerifi: Mozilla''s cert list.\n* New
